import React, { useState, useEffect } from "react";
import axios from "axios";

interface IPost {
  results: [
    {
      gender: string;
      name: {
        title: string;
        first: string;
        last: string;
      };
      location: {
        city: string;
      };
      dob: {
        date: string;
      };
    }
  ];
}

const UserService = () => {
    alert("yes")
    axios
    .get<IPost[]>("https://randomuser.me/api/?results=1")
    .then((response) => {
      return response.data;
 });
}
export default UserService;
